import { View,ScrollView } from "react-native";
import MySelfUser from "../1HelpFullFolder/MySelfUser";
import { footerstyles } from "../Styles/FooterStyle";
import Folder from "./Footer containers/Folder";
interface FooterProps {
    user: MySelfUser;
  }
  
  export default function Footer({ user }: FooterProps) {
    return (
      <View style={footerstyles.container} >
        <ScrollView horizontal={true} style={footerstyles.scrollView}>
        {user.folders.map((folder, index) => (
        <Folder key={index} textStyle={footerstyles.folder} containerStyle={footerstyles.folderContainer} text={folder.name} />
      ))}
      </ScrollView>
      </View>
    );
  }
